	<rect x="362.94" y="42.68" class="st3" width="508.14" height="761.49"/>
	<text id="texto" transform="matrix(1 0 0 1 362.9391 51.3169)" class="st4"><tspan x="0" y="0" class="st5 st6 st7">Señor presidente,</tspan><tspan x="0" y="14.4" class="st5 st6 st7">Señorías:</tspan><tspan x="0" y="43.2" class="st5 st6 st7">Desde las ruinas y las cenizas en que las guerras mundiales dejaron sumida a Europa, los </tspan><tspan x="0" y="57.6" class="st5 st6 st7">padres y madres fundadores consiguieron llevar a buen puerto una misión formidable, la </tspan><tspan x="0" y="72" class="st5 st6 st7">instauración de la paz.</tspan><tspan x="0" y="100.8" class="st5 st6 st7">Hoy tenemos un mercado común sólido, en el que los europeos podemos comerciar, viajar,</tspan><tspan x="0" y="115.2" class="st5 st6 st7">investigar y trabajar sin fronteras. De Riga a Limassol, de Atenas a Lisboa, 500 millones de</tspan><tspan x="0" y="129.6" class="st5 st6 st7">europeos vivimos en prosperidad y libertad.</tspan><tspan x="0" y="158.4" class="st5 st6 st7">La generación de mis hijos no puede imaginarse una vida sin este sentimiento de identidad</tspan><tspan x="0" y="172.8" class="st5 st6 st7">común europea. Cuando esta afortunada generación nació, también los mayores pensábamos </tspan><tspan x="0" y="187.2" class="st5 st6 st7">que siempre sería así.</tspan><tspan x="0" y="216" class="st5 st6 st7">Hoy, en cambio, nadie duda de que una vez más tenemos que luchar y movilizarnos por </tspan><tspan x="0" y="230.4" class="st5 st6 st7">Europa. El mundo entero se enfrenta a perturbadoras turbulencias que también afectan a </tspan><tspan x="0" y="244.8" class="st5 st6 st7">Europa.</tspan><tspan x="0" y="273.6" class="st5 st6 st7">Estamos hablando del cambio demográfico, de la globalización de la economía, de la </tspan><tspan x="0" y="288" class="st5 st6 st7">vertiginosa digitalización del mundo laboral y, naturalmente, del cambio climático. Ninguno de </tspan><tspan x="0" y="302.4" class="st5 st6 st7">estos metafenómenos es nuevo; hace ya tiempo que habían sido previstos por los científicos. </tspan><tspan x="0" y="316.8" class="st5 st6 st7">Lo que sí es novedoso es que ahora los ciudadanos y ciudadanas de Europa, sea cual sea el </tspan><tspan x="0" y="331.2" class="st5 st6 st7">país en que vivamos, los sentimos en primera persona y nos vemos directamente afectados.</tspan><tspan x="0" y="360" class="st5 st6 st7">Piensen en los productores de trigo finlandeses afectados por la sequía o en quienes sufren </tspan><tspan x="0" y="374.4" class="st5 st6 st7">una letal ola de calor en Francia: todos sentimos en primera persona los efectos del cambio </tspan><tspan x="0" y="388.8" class="st5 st6 st7">climático.</tspan><tspan x="0" y="417.6" class="st5 st6 st7">Lo mismo ocurre con una pensionista irlandesa que necesita que le expliquen cómo funciona la </tspan><tspan x="0" y="432" class="st5 st6 st7">banca en línea, o con un trabajador polaco que después de veinte años de trabajo necesita</tspan><tspan x="0" y="446.4" class="st5 st6 st7">formación incluso para mantener su empleo: todos sentimos los efectos concretos de la</tspan><tspan x="0" y="460.8" class="st5 st6 st7">digitalización. Es el caso también de las regiones europeas en las que escuelas, hospitales o</tspan><tspan x="0" y="475.2" class="st5 st6 st7">empresas se ven obligados a cerrar: todos sentimos los efectos del cambio demográfico.</tspan><tspan x="0" y="504" class="st5 st6 st7">Todo esto ha dejado a los ciudadanos con una sensación de pérdida de control, de vínculos</tspan><tspan x="0" y="518.4" class="st5 st6 st7">menos sólidos dentro de nuestras comunidades. Ninguno de estos problemas desaparecerá, </tspan><tspan x="0" y="532.8" class="st5 st6 st7">pero ha habido diferentes formas de reaccionar ante ellos: algunos países se están </tspan><tspan x="0" y="547.2" class="st5 st6 st7">convirtiendo en regímenes autoritarios, otros están comprando su influencia mundial y creando </tspan><tspan x="0" y="561.6" class="st5 st6 st7">dependencias</tspan><tspan x="0" y="576" class="st5 st6 st7">mediante inversiones en puertos y carreteras. Y otros se están inclinando por el </tspan><tspan x="0" y="590.4" class="st5 st6 st7">proteccionismo.</tspan><tspan x="0" y="619.2" class="st5 st6 st7">Ninguna de estas opciones es válida para nosotros. Queremos multilateralismo, queremos un</tspan><tspan x="0" y="633.6" class="st5 st6 st7">comercio justo, defendemos un orden basado en normas porque sabemos que es mejor para</tspan><tspan x="0" y="648" class="st5 st6 st7">todos nosotros. Tenemos que hacerlo con la forma europea de actuar. Pero si queremos</tspan><tspan x="0" y="662.4" class="st5 st6 st7">avanzar por la senda europea, hemos de redescubrir, en primer lugar, nuestra unidad. Si</tspan><tspan x="0" y="676.8" class="st5 st6 st7">estamos unidos interiormente, nadie nos dividirá desde fuera.</tspan><tspan x="0" y="705.6" class="st5 st6 st7">Si solventamos las diferencias que existen entre nosotros, podemos convertir los retos de hoy </tspan><tspan x="0" y="720" class="st5 st6 st7">en las oportunidades de mañana.</tspan></text>
	<rect x="9.7" y="453.95" class="st8" width="299.21" height="215.1"/>
	<rect x="21.61" y="464.72" class="st3" width="279.27" height="196.55"/>
	<text transform="matrix(1 0 0 1 21.6066 474.07)" class="st4"><tspan x="0" y="0" class="st5 st9 st10">Finlandia, y en general toda Escandinavia, </tspan><tspan x="0" y="15.6" class="st5 st9 st10">sufrieron en el verano de 2018 una fortísima ola </tspan><tspan x="0" y="31.2" class="st5 st9 st10">de calor, que provocó muchos incendios en la </tspan><tspan x="0" y="46.8" class="st5 st9 st10">región. Tanto ese Estado miembro como Suecia </tspan><tspan x="0" y="62.4" class="st5 st9 st10">tuvieron que pedir ayuda a la Comisión Europea </tspan><tspan x="0" y="78" class="st5 st9 st10">para hacer frente a los incendios forestales. </tspan><tspan x="0" y="93.6" class="st5 st9 st10">Aquel verano se registró en Laponia el máximo </tspan><tspan x="0" y="109.2" class="st5 st9 st10">histórico: 33 grados. Este mismo verano, la ola </tspan><tspan x="0" y="124.8" class="st5 st9 st10">de calor registrada en Francia dejó, según el </tspan><tspan x="0" y="140.4" class="st5 st9 st10">Ministerio de Salud, 1.432 muertos. Una cifra </tspan><tspan x="0" y="156" class="st5 st9 st10">altísima, pero baja si se compara con los 15.000 </tspan><tspan x="0" y="171.6" class="st5 st9 st10">muertos que se calcula que dejó la ola de 2003. </tspan></text>
	<rect x="55.05" y="129.76" class="st8" width="249.91" height="207.15"/>
	<rect x="66.29" y="140.54" class="st3" width="230.63" height="196.37"/>
	<text transform="matrix(1 0 0 1 66.2925 149.8875)" class="st4"><tspan x="0" y="0" class="st5 st9 st10">Von der Leyen tardó muy poco en </tspan><tspan x="0" y="15.6" class="st5 st9 st10">mencionar el cambio climático en su </tspan><tspan x="0" y="31.2" class="st5 st9 st10">discurso. Durante las semanas y los </tspan><tspan x="0" y="46.8" class="st5 st9 st10">días previos a su intervención ante el </tspan><tspan x="0" y="62.4" class="st5 st9 st10">Pleno de Estrasburgo, la alemana se </tspan><tspan x="0" y="78" class="st5 st9 st10">vio obligada a hacer ofertas concretas a </tspan><tspan x="0" y="93.6" class="st5 st9 st10">Verdes, Liberales y Socialdemócratas </tspan><tspan x="0" y="109.2" class="st5 st9 st10">en el campo del cambio climático para </tspan><tspan x="0" y="124.8" class="st5 st9 st10">lograr sus votos a favor. Las elecciones </tspan><tspan x="0" y="140.4" class="st5 st9 st10">europeas de mayo de 2019 habían </tspan><tspan x="0" y="156" class="st5 st9 st10">dejado claro que este ya no era un </tspan><tspan x="0" y="171.6" class="st5 st9 st10">tema secundario.</tspan></text>

	<text id="texto_1_" transform="matrix(1 0 0 1 1077.8804 51.3169)" class="st4"><tspan x="0" y="0" class="st5 st6 st7">Nuestro reto más acuciante es mantener nuestro planeta saludable. Esta es la mayor</tspan><tspan x="0" y="14.4" class="st5 st6 st7">responsabilidad y oportunidad de nuestro tiempo. Quiero que Europa se convierta en el</tspan><tspan x="0" y="28.8" class="st5 st6 st7">primer continente climáticamente neutro del mundo en 2050. Para que esto sea posible,</tspan><tspan x="0" y="43.2" class="st5 st6 st7">debemos adoptar juntos medidas audaces. Nuestro objetivo actual de reducir nuestras</tspan><tspan x="0" y="57.6" class="st5 st6 st7">emisiones en un 40 % para 2030 no es suficiente.</tspan><tspan x="0" y="86.4" class="st5 st6 st7">Debemos ir más allá, esforzarnos por llegar a más. Es necesario un planteamiento en dos </tspan><tspan x="0" y="100.8" class="st5 st6 st7">fases para reducir las emisiones de CO2 de aquí a 2030 en un 50 % o incluso en un 55 %. La </tspan><tspan x="0" y="115.2" class="st5 st6 st7">UE liderará las negociaciones internacionales para que aumente el nivel de ambición de otras</tspan><tspan x="0" y="129.6" class="st5 st6 st7">economías importantes de aquí a 2021. Porque para lograr un impacto real no solo debemos </tspan><tspan x="0" y="144" class="st5 st6 st7">ser ambiciosos en casa, que debemos, sino que el mundo debe avanzar al unísono.</tspan><tspan x="0" y="172.8" class="st5 st6 st7">Para conseguirlo, en mis primeros 100 días en el cargo propondré un Pacto Verde para</tspan><tspan x="0" y="187.2" class="st5 st6 st7">Europa. Presentaré la primera Ley Europea sobre el Clima que transformará en norma el </tspan><tspan x="0" y="201.6" class="st5 st6 st7">objetivo de 2050. Este aumento de la ambición requerirá una inversión de gran calado. No </tspan><tspan x="0" y="216" class="st5 st6 st7">bastará con los fondos públicos. Propondré un Plan de Inversiones Sostenibles para Europa y </tspan><tspan x="0" y="230.4" class="st5 st6 st7">la conversión de parte del Banco Europeo de Inversiones en un Banco Climático, lo que permi</tspan><tspan x="500.96" y="230.4" class="st5 st6 st7">-</tspan><tspan x="0" y="244.8" class="st5 st6 st7">tirá desbloquear un billón de euros de inversión durante la próxima década. Esto trae consigo </tspan><tspan x="0" y="259.2" class="st5 st6 st7">cambios. Todos nosotros y todos los sectores tendremos que contribuir, desde la aviación </tspan><tspan x="0" y="273.6" class="st5 st6 st7">hasta el transporte marítimo, pasando por la forma en que cada uno de nosotros viaja y vive. </tspan><tspan x="0" y="288" class="st5 st6 st7">Las emisiones deben tener un precio que cambie nuestro comportamiento.</tspan><tspan x="0" y="316.8" class="st5 st6 st7">Para complementar esta labor y garantizar que nuestras empresas puedan competir en igual</tspan><tspan x="493.61" y="316.8" class="st5 st6 st7">-</tspan><tspan x="0" y="331.2" class="st5 st6 st7">dad de condiciones, introduciré un impuesto sobre el carbono en frontera para evitar fugas de </tspan><tspan x="0" y="345.6" class="st5 st6 st7">carbono. Pero lo que es bueno para nuestro planeta debe ser también bueno para nuestra </tspan><tspan x="0" y="360" class="st5 st6 st7">población y nuestras regiones. Por supuesto, soy consciente de la importancia de los fondos </tspan><tspan x="0" y="374.4" class="st5 st6 st7">de cohesión. Pero necesitamos más. Necesitamos una transición justa para todos.</tspan><tspan x="0" y="403.2" class="st5 st6 st7">No todas nuestras regiones parten del mismo punto, pero todos compartimos el mismo destino. </tspan><tspan x="0" y="417.6" class="st5 st6 st7">Por ello, propondré un Fondo de Transición Justa que apoye a quienes resulten más</tspan><tspan x="0" y="432" class="st5 st6 st7">afectados.</tspan><tspan x="0" y="460.8" class="st5 st6 st7">Esta es la forma europea de actuar: somos ambiciosos, no dejamos a nadie atrás y ofrecemos </tspan><tspan x="0" y="475.2" class="st5 st6 st7">perspectivas de futuro. Si queremos tener éxito con este ambicioso plan, necesitamos una </tspan><tspan x="0" y="489.6" class="st5 st6 st7">economía fuerte porque lo que queremos gastar tenemos que ganarlo primero.</tspan></text>
	<rect x="605.01" y="996.11" class="st8" width="317.55" height="308.52"/>
	<rect x="1660.41" y="88.43" class="st3" width="298.95" height="314.76"/>
	<text transform="matrix(1 0 0 1 1660.4078 97.7816)" class="st4"><tspan x="0" y="0" class="st5 st9 st10">La neutralidad climática (y la fecha en la que </tspan><tspan x="0" y="15.6" class="st5 st9 st10">alcanzarla) es uno de los principales debates sobre </tspan><tspan x="0" y="31.2" class="st5 st9 st10">medioambiente en la UE. Un grupo de países se </tspan><tspan x="0" y="46.8" class="st5 st9 st10">oponen a que se exija endurecer el objetivo para </tspan><tspan x="0" y="62.4" class="st5 st9 st10">2030 (actualmente situado en una reducción del </tspan><tspan x="0" y="78" class="st5 st9 st10">40% de las emisiones), pero Von der Leyen se </tspan><tspan x="0" y="93.6" class="st5 st9 st10">alinea con el Parlamento Europeo, que impulsa una </tspan><tspan x="0" y="109.2" class="st5 st9 st10">mayor ambición. Evidentemente lo hizo con la </tspan><tspan x="0" y="124.8" class="st5 st9 st10">esperanza de recoger más votos, por eso propone </tspan><tspan x="0" y="140.4" class="st5 st9 st10">llevar el objetivo hasta el 50% o el 55%.</tspan><tspan x="0" y="171.6" class="st5 st9 st10">Todo apunta a que si no se endurecen los objetivos </tspan><tspan x="0" y="187.2" class="st5 st9 st10">para 2030 no se logrará la neutralidad climática en </tspan><tspan x="0" y="202.8" class="st5 st9 st10">2050, que es el objetivo de la UE para cumplir con </tspan><tspan x="0" y="218.4" class="st5 st9 st10">el Acuerdo de París de 2015. Los cálculos de la </tspan><tspan x="0" y="234" class="st5 st9 st10">Comisión Europea señalan que, sin medidas </tspan><tspan x="0" y="249.6" class="st5 st9 st10">adicionales, en 2050 solo se reducirían las </tspan><tspan x="0" y="265.2" class="st5 st9 st10">emisiones en un 60%, lejos del objetivo del 80%.</tspan></text>
